(191, 'PENDIENTE DE PAGO', '17/08/2018', '06:37:54', 'Centro Funerario en Altura', '901', 'Manuel Fortis', 'Granada', 'HUETOR TAJAR', 'Funeraria Tanatorio  Huetor Tajar ', '', '', '', '', '', '', '', '', '', '', 'Los amigos de tus hijos te acompañan', 'Tato y Carlos, en estos momentos tan duros, sentimos no poder estar a vuestro lado, pero desde la distancia todos nuestros pensamientos están en vosotros. \r\n\r\nOs queremos! Un abrazo fuerte.. \r\nDe Gonzalo, Chanke, Marcos y Nachito.', 'Gonzalo Schiaffino', '616238841', 'gonzaloschiaffino@gmail.com', 'si', 'Gonzalo Schiaffino', '75137947Y', 'GRANADA', 'Granada', 'Av. Fuerzas Armadas 23', '18014', 'gonzaloschiaffino@gmail.com', '616238841', 'En el hierro tiene lugar en el cementerio de Huetor Tajar en Granada a las 19.00 del 17/08/2018. \r\nEntregar a nombre de José Manuel Fortis Argente del Castillo\r\n\r\n*Quizás no pueda responder al teléfono por encontrarme actualmente en Vietnam. Por favor contactenme vía email y responderé de inmediato.', '18/8/2018', 'tarjeta', '86', '', '6'),
